import React from 'react';


export default class Contact extends React.Component {
    render() {
        return (
            <React.Fragment>
                <div className="about-container">
                    <div className="center-container">
                        <h1>Contact</h1>
                        <p>Want to get in touch? Shoot us an email!</p>
                        <div>
                            <div>CUSEC EMAIL ACCOUNTS</div>
                            <p>sponsor@cusec.net ~ Contact for information about sponsoring the event</p>
                        </div>
                    </div>
                </div>
            </React.Fragment>
        )
    }

}
